-
I used to wind these by hand, then came up with this: The ribbon spindle from a dead Olivetti Lettera 22, chucked into an electric drill. A full 16 yards of ribbon spools up in about a minute. 😈
-
Most of the time I end up winding ribbon onto vintage spools, so I don’t bother spooling these up in pairs and just use one spool per ribbon. With ribbons already eyeletted and cut to length it only takes a minute or two to outfit a waiting machine with a freshie.
-
There’s thousands of pages here, waiting to be unleased. Hundreds of thousands of words ready to go. That’s serious horsepower.
-
Enjoy the long weekend. And take some time to write! 🤓
